import React from "react";
import "../css/FixModal.css";
const FixModal = ({ header, errorData, open, setOpen }) => {
  console.log(errorData, "errorData");

  const { name } = header;

  const dismissModal = (e) => {
    if (e.target.id === "fix-modal") {
      setOpen(false);
    }
  };

  if (open) {
    return (
      <div
        id="fix-modal"
        className="fix-modal"
        onClick={(e) => dismissModal(e)}
      >
        <div className="fix-modal-content">
          <p className="modal-index">{name} errors</p>
          <div className="modal-table">
            <div className="modal-table-headers">
              {Object.keys(header).map((item) => {
                <div className="modal-table-header">{item}</div>;
              })}
            </div>
          </div>
          {errorData &&
            errorData.map((item, index) => {
              return <div key={index}>{item.SKU}</div>;
            })}
        </div>
      </div>
    );
  } else {
    return null;
  }
};

export default FixModal;
